import React from 'react';

const image = document.getElementById('inputimage');
const Rectangle = (...props) => {
    console.log(this.parent.height);
    return(
        <div className='absolute flex flex-wrap justify-center ' style={{top: (props.topRow), bottom: props.bottomRow, right: props.rightCol, left: props.leftCol}}>

        </div>
    );
}
export default Rectangle;
